import React from 'react'
import '../scss/SubTitle.scss'

function SubTitle(size) {
    return (
        <h2><a className={size} href="#">멋쟁이 제작자 이야기 <p>더보기</p></a></h2>
    )
}

SubTitle.defaultProps = {
    size: 'large'
}

export default SubTitle
